import base64
import zlib
import xml.etree.ElementTree as ET

def _fetch_xml_from_import_code(import_code: str) -> bytes:
    """Decodes and unzips a Path Of Building import code.

    :raises: :class:`TypeError`, :class:`ValueError`

    :return: Decompressed XML build document."""
    try:
        base64_decode = base64.urlsafe_b64decode(import_code)
        decompressed_xml = zlib.decompress(base64_decode)
        return decompressed_xml
    except (TypeError, ValueError):
        print("Failed to decode import code")
        return b''

def save_xml_to_file(xml_data: bytes, filename: str) -> None:
    """Saves the decompressed XML data to a file."""
    try:
        with open(filename, 'wb') as file:
            file.write(xml_data)
        print(f"XML data has been saved to {filename}")
    except Exception as e:
        print(f"Failed to save XML data: {e}")

def parse_xml_and_save_item_texts(xml_data: bytes, filename: str) -> None:
    """Parses the XML data and saves the inner text of <Item> elements to a file."""
    try:
        root = ET.fromstring(xml_data)
        items = root.findall('.//Item')

        # Get inner text from each <Item> element, preserving the format
        item_texts = []
        for item in items:
            item_text = ET.tostring(item, encoding='unicode', method='text').strip()
            item_texts.append(item_text)

        # Save the inner text to a file
        with open(filename, 'w', encoding='utf-8') as file:
            for text in item_texts:
                file.write(text + '\n\n')
        print(f"Inner text of <Item> elements has been saved to {filename}")
    except ET.ParseError as e:
        print(f"Failed to parse XML data: {e}")

